import axios from "axios";
import { KEY_STATS } from "../ActionTypes";

const url = "/graphql";

export const fetchKeyStats = () => async dispatch => {
  try {
    const groupQuery = `query{
    groupStats{
      groupTotal    
     groupsLastMonth{
        data{
          count
          day{
            year
            month
            day
          }     
        }
    }
    groupsLastYear{
        data{
          month
          count  
        }
      }

    }
    }`;

    let groupResponse;

    groupResponse = await axios({
      url,
      method: "post",
      data: {
        query: groupQuery
      }
    });

    console.log(groupResponse);

    const data = `query{
    keyStats{
      userTotal
      groupTotal
      meetingTotal
      shareTotal
      userGender{
        value
        count
       }
       usersLastYear{
        data{
          month
          count
        }
      }  
     groupsLastMonth{
        data{
          count
          day{
            year
            month
            day
          }     
        }
    }
    groupsLastYear{
        data{
          month
          count  
        }
      }
    meetingsLastYear{
        data{
          month
          count
        }
      }

    }
    }`;

    let response;

    response = await axios({
      url,
      method: "post",
      data: {
        query: data
      }
    });

    dispatch({
      type: KEY_STATS,
      payload: response.data.data.keyStats
    });
  } catch (err) {
    console.log(err);
  }
};
